-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT '序号',
  `user_name` varchar(30) NOT NULL COMMENT '工号',
  `phone_num` varchar(11) NOT NULL COMMENT '手机号',
  `real_name` varchar(30) NOT NULL COMMENT '姓名',
  `address` varchar(255) DEFAULT NULL,
  `status` varchar(30) NOT NULL DEFAULT '1' COMMENT '是否有效（0-无效；1有效）',
  `birthday` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '入职时间',
  `id_no` varchar(20) NOT NULL COMMENT '最后登录时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `password` varchar(50) DEFAULT NULL COMMENT '密码',
  `head_icon` varchar(255) NOT NULL DEFAULT '' COMMENT '头像',
  `salt` varchar(50) DEFAULT NULL COMMENT '用户盐',
  `email` varchar(50) NOT NULL COMMENT '同步时间',
  `locked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否锁定（0-否；1-是）',
  `sex` varchar(5) DEFAULT NULL COMMENT '性别',
  `account_status` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `un_app_user_employee_number` (`user_name`) USING BTREE,
  KEY `un_app_user_group_id` (`sex`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=20610 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户表';

